import Item from "./components/Item";
import "./App.css";
function App() {
  let list = new Array();
  list = [
    {
      id: "i1",
      item_date: new Date("2022-12-20"),
      item_name: "Car insurance",
      item_price: 500,
    },
    {
      id: "i1",
      item_date: new Date("2022-12-20"),
      item_name: "Car insurance",
      item_price: 500,
    },
    {
      id: "i1",
      item_date: new Date("2022-12-20"),
      item_name: "Car insurance",
      item_price: 500,
    },
    {
      id: "i1",
      item_date: new Date("2022-12-20"),
      item_name: "Car insurance",
      item_price: 500,
    },
  ];
  return (
    <div className="list">
      <center>
        <h1 className="head">EXPENSE TRACKER</h1>
      </center>
      <Item
        date={list[0].item_date}
        name={list[0].item_name}
        price={list[0].item_price}
      ></Item>
      ;
      <Item
        date={list[1].item_date}
        name={list[1].item_name}
        price={list[1].item_price}
      ></Item>
      ;
      <Item
        date={list[2].item_date}
        name={list[2].item_name}
        price={list[2].item_price}
      ></Item>
      ;
    </div>
  );
}
export default App;
